class header extends Component {
    render() {
        return (
            <div id="hero-container">
        <img className="hero" src="image/background.jpeg" />
        <p1 className="t0">
          <strong>I am Do Thai Duong</strong> 
        </p1>
        <p2 className="t1">
          And I'm a IT Student of NLU
        </p2>
        <a href="#about" className="btn-get-started scrollto mid">
          <i><img src="image/scroll.png" /></i>
        </a>
      </div>
        );
    }
}

export default header;
